import React, { useState } from "react";
import "./styles/nav.css";

const Nav = () => {
  return (
    <>
      <div className="card">
        <a href="#">About</a>
        <a href="#">Services</a>
        <a href="#">Clients</a>
        <a href="#">Contact</a>
      </div>
    </>
  );
};

export default Nav;
